import React, { Component, useState } from "react";

export default class Login extends Component {
    render() {




        const [username, setUsername ] = useState('')
        const [password, setPassword ] = useState('')
        const submit = (e) => {
            e.prevenDefault()
        console.log({
            username ,
            password,
        })
        } 
        return (
            <form onSubmit={submit}>
                <h3>Log in</h3>
                <div className="form-group" >
                    <label>Username</label>
                    <input type="username" className="form-control" placeholder="Enter username" id = "username"  required onChange={ e => setUsername(e.target.value)}/>
                </div>

                <div className="form-group">
                    <label>Password</label>
                    <input type="password" className="form-control" placeholder="Enter password" id = "password" required onChange={ e => setUsername(e.target.value) }/>
                </div>

                <div className="form-group">
                    <div className="custom-control custom-checkbox">
                        <input type="checkbox" className="custom-control-input" id="customCheck1" />
                        <label className="custom-control-label" htmlFor="customCheck1">Remember me</label>
                    </div>
                </div>

                <button type="submit" className="btn btn-dark btn-lg btn-block"  >Sign in</button>
            </form>
        );
    }
}
